  const [tal, setTal] = useState();
  // const a =
  useEffect(() => {
    fetch("https://jsonplaceholder.typicode.com/posts")
      .then((response) => response.json())
      .then((json) => setTal(json));
  }, [gradeForSubject]);
  console.log(tal);
  function deleteGet() {
    fetch("https://jsonplaceholder.typicode.com/posts/1", {
      method: "DELETE",
    })
      .then((response) => response.json())
      .then((json) => setTal(json));
  }
  function Filtro1() {
    fetch("https://jsonplaceholder.typicode.com/posts?userId=1")
      .then((response) => response.json())
      .then((json) => setTal(json));
  }

  return (
    <>
      <Head>
        <title>Seja bem vindo</title>
      </Head>
      <div>
        <>
          <button
            onClick={() => {
              Filtro1();
            }}
          >
            Filtro 1
          </button>

          <br></br>

          {/* {tal.map((post) => {
            return (
              <>
                <span>{post.id}</span>
                <button
                  onClick={() => {
                    deleteGet(post.id);
                  }}
                >
                  Delete
                </button>
                <br />
              </>
            );
          })} */}
        </>
      </div>
      ); };
    </>
  );
}
Page.getInitialProps = async () => {
  return {};
};
export default Page;
